      eligibleBenefitIds = eligibleBenefitIds.concat(ep.benefits);
    }
  });
  var benefitIdsForSelectedNeeds = [];

  if (Object.keys(selectedNeeds).length > 0) {
    Object.keys(selectedNeeds).forEach(function (id) {
      var need = needs.filter(function (n) {
        return n.id === id;
      })[0];
      benefitIdsForSelectedNeeds = benefitIdsForSelectedNeeds.concat(need.benefits);
    });
  } else {
    benefitIdsForSelectedNeeds = benefits.map(function (b) {
      return b.id;
    });
  }

  var matchingBenefitIds = eligibleBenefitIds.filter(function (id) {
    return benefitIdsForSelectedNeeds.indexOf(id) > -1;
  });
  var matchingBenefits = benefits.filter(function (b) {
    return matchingBenefitIds.includes(b.id);
