          q.term(term, {
            usePipeline: true,
            boost: 100
          });
          q.term(term, {
            usePipeline: false,
            boost: 10,
            wildcard: lunr.Query.wildcard.LEADING | lunr.Query.wildcard.TRAILING
          });
          q.term(term, {
            usePipeline: false,
            editDistance: 1
          });
        });
      });
    }

    var resultIds = results.map(function (r) {
      return r.ref;
    });
    matchingBenefits = matchingBenefits.filter(function (b) {
      return resultIds.includes(b.id);
    });
  }

  return matchingBenefits;
});

